import React from "react";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";
import Box from "@mui/material/Box";
import { useLocation } from "react-router-dom";
import { createTheme, ThemeProvider, styled } from "@mui/material/styles";

const VehicleStatus = () => {
  const { pathname } = useLocation();
  const Item = styled(Paper)(({ theme }) => ({
    ...theme.typography.body2,
    textAlign: "h3",
    color: theme.palette.text.secondary,
    height: 60,
    lineHeight: "60px",
  }));
  const lightTheme = createTheme({ palette: { mode: "light" } });
  const statusArr ={
    elevation:"200m",
    temperature:"30c",
    locked:false,
    battery:"75.6%",
    throttle:true,
    controller:true,
    motor:true,
    overload:true,
    overcurrent:true,
}

  return (
    <div>
      <div
        style={{
          margin: "20px",
        }}
      >
        Vehicle &gt; {pathname.slice(1, 6)}
      </div>
      <h3>vehicle status</h3>
      <Grid container spacing={2}>
        {[lightTheme].map((theme, index) => (
          <Grid item xs={6} key={index}>
            <ThemeProvider theme={theme}>
              {/* <Box
                sx={{
                  p: 2,
                  bgcolor: "#DFDFDE",
                  display: "grid",
                  gridTemplateColumns: { md: "200px 200px" },
                  gridTemplateRows: { md: "50px 50px 50px 50px" },
                  gap: 2,
                  height: "220px",
                  width: "450px",
                  borderRadius: "2px",
                }}
              > */}
                {/* {statusArr.map((elevation,key) =>(
                  <Item key={key} elevation={0}>
                    {`   ${elevation[key]}`}
                  </Item>
                ))} */}

              {/* <Item> */}
              <div style={
                  {
                    display:"flex",
                    flexDirection:"row",

                  }
                }>
                <div style={{
                  display:"flex",
                  flexDirection:"column",
                  justifyContent:"space-evenly",
                  border:"2px solid black",
                  padding:"20px",
                  width:"200px"
                }}>
                  <span style={{justifyContent:"space-between"}}>Elevation:{statusArr.elevation}</span>
                  <span>Temperature:{statusArr.temperature}</span>
                  <span>Loacked:{statusArr.locked}</span>
                  <span>Battery:{statusArr.battery}</span>
                </div>
                <div style={{
                  display:"flex",
                  flexDirection:"column",
                  justifyContent:"space-evenly",
                  // border:"2px solid black",
                  padding:"20px",
                  width:"200px"
                }}>
                  <span>Throttle:({statusArr.throttle}&#10003; <i></i>)</span>
                  <span>Controller:{statusArr.controller}</span>
                  <span>Motor:{statusArr.motor}</span>
                  <span>Overload:{statusArr.overload}</span>
                  <span>Overcurrent:{statusArr.overcurrent}</span>
                </div>
                </div>
              {/* </Item> */}
              {/* </Box> */}
            </ThemeProvider>
          </Grid>
        ))}
      </Grid>
    </div>
  );
};

export default VehicleStatus;
